import React, { Component } from 'react';

class Links extends Component {
  render() {

    return(
    <div className="animated fadeIn">
      <h3>-- CODE --</h3>
      <p>Sburbd on Github</p>
      <h3>-- TWITTER --</h3>
      <p>Main Twitter</p>
      <p>Art reblog Twitter</p>
      <h3>-- DISCORD --</h3>
      <p>Add me on Discord</p>
      <p>HS JP/KOR study discord</p>

    </div>
    )
  }
}

export default Links;
